import "./LoanForm.css";
export default function LoanForm() {
  return (
    <div className="LoanForm">
      <form>
        <h1>request a loan</h1>
        <hr></hr>
        <label htmlFor="name">Name:</label>
        <input
          type="text"
          id="name"
          name="name"
          placeholder="Enter your name"
          required
        />
      </form>
    </div>
  );
}
